import React from 'react'
import {Line} from 'react-chartjs-2';
import myData from '../data.json';
import {
    Chart as ChartJS,
    CategoryScale,
    LinearScale,
    PointElement,
    LineElement,
    Title,
    Tooltip,
    Legend,
  } from 'chart.js';
  
ChartJS.register(CategoryScale, LinearScale, PointElement, LineElement, Title, Tooltip, Legend);

const data = {
    labels: [
        "RUG",
         "UvA",
         "RU",
         "VU",
         "TUD",
         "TUE",
         "WUR",
         "EUR",
         "UU",
         "LU",
         "UM",
         "UT",
         "UvT"],
    dataset: [
        {
            label: 'Dataset of PhD Theses',
            fill: false,
            lineTension:0.1,
            

        }
    ]
};






function ThesesChart() {
    return (
       <>
       <div>Dengey</div>
       </>
    );
}

export default ThesesChart
